import React, { useState, useEffect } from 'react'
import { Button, Col, Divider, Row } from 'antd'
import { logdata_request } from '../../api';
import { DataSortTime, GetDateTime, LogDataMappingTime } from '../../DataRequest/LogDataRequestWrap';
import { C3Model } from '../../DataRequest/DataModel';

let LogValue = {
    "LogC3": [],
    "LogG2": [],
}



const Line1Report = () => {

    const [state, setState] = useState({ count: 0 });
    
    const TestGet = () =>{
        UpdateTableData()
    }


    const UpdateTableData = async () => {
        let DateTimeRange = GetDateTime(1)
        const response = await logdata_request([], DateTimeRange[0], DateTimeRange[1], 'PolymerLink', 'C3', '1')

        LogValue['LogC3'] = LogDataMappingTime(C3Model, DataSortTime(response))
        console.log(LogValue['LogC3']);
    }


    return (
        <div>
<Button onClick={TestGet}> test </Button>
        </div>
    )


}

export default Line1Report
